import React from "react";
import { Bar } from "react-chartjs-2";

export default function Func() {
  return (
    <>
      <div className="card-body" style={{ flex: 1 }}>
        <Bar
          data={{
            labels: ["a", "b", "c"],
            datasets: {
              labels: ["Mychart"],
              data: [100, 200, 300],
            },
          }}
        />
      </div>
    </>
  );
}
